import React from 'react';

/** 
 *! Moment date and time format এর জন্য
 **/
import Moment from 'react-moment';

/** 
 *! Data validation এর জন্য
 **/
import PropTypes from 'prop-types';


const LogItem = ({ log }) => {

    return (
        <li className="collection-item">
            <div>
                <a href="#edit-log-modal" className={`modal-trigger ${log.attention ? 'red-text' : 'blue-text'}`}> {log.message} </a>
                <br />
                <span className="grey-text">
                    <span className="black-text">
                        ID #{log.id}
                    </span>
                    {''} last updated by {''}
                    <span className="black-text">
                        »»»{log.tech}
                    </span> on <Moment format='MMMM Do YYYY, h:mm:ss a'>{log.date}</Moment> {/** Moment date and time format */}
                    <a href="#!" className="secondary-content">
                        <i className="material-icons grey-text"> delete </i>
                    </a>
                </span>
            </div>
        </li>
    );
};

LogItem.propTypes = {
    log: PropTypes.object.isRequired
}

export default LogItem;
